import React, { Component } from 'react'
import { Co } from './App';
export default class Guest extends Component {
    render() {
        return (
            <div>
               <MyContext.Consumer>
                    {({data,method}) =>( 
                        <div>
                            <h2>
                            Name: {data.name} , Value: {data.value}
                            </h2>
                            <button onClick={method}>Click</button>
                        </div>
                        )}
               </MyContext.Consumer>
            </div>
        )
    }
}
